import React, { Component } from 'react';
import '../App.css';

class QuestionHolder extends Component {
	render() {
		return (
			<div>
				<h2>{this.props.q}</h2>
				<h3>{this.props.unit}</h3>
			</div>
		);
	}
}

export default QuestionHolder;
